import React, {useContext} from 'react'
import { Link } from 'react-router-dom'


const NotLoggedUser = () => {
  return (
    <ul class="navbar-nav mb-2 mb-lg-0 d-flex">
        <li class="nav-item dropdown">
                <Link to='login' className='nav-link'></Link>
        </li>
    </ul>
  )
}

export default NotLoggedUser
